import React from "react";
import { Row, Col, Form as BForm } from "react-bootstrap";
export default function Form(props) {
  return (
    <Row>
      <Col>
        <BForm>
          <BForm.Group>
            <BForm.Label>Description</BForm.Label>
            <Form.Control
              value={props.form.description}

              type="text"
              placeholder="Run, plank"
            />
          </BForm.Group>
        </BForm>
      </Col>
    </Row>
  );
}
